import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Routes, Route}
    from 'react-router-dom';
import Home from './pages';
import Espace_administration from '';
import Espace_jurys from './Pages/Espace Jurys/Espace_Jurys.js';
import Espace_superviseur from '.Pages/Espace Superviseur/Espace_Superviseur.js';


function App() {
return (
    <Router>
    <Navbar />
    <Routes>
        <Route exact path='/' exact element={<Home />} />
        <Route path='/administration' element={<Espace_administration/>} />
        <Route path='/jurys' element={<Espace_jurys/>} />
        <Route path='/superviseur' element={<Espace_superviseur/>} />

    </Routes>
    </Router>
);
}

export default App;
